data.description:
When set, a download is invoked using a Blob.
Accepts an object with the following structure:
      {
        filename: string;
        content: any;
        isBase64: boolean (optional);
        isDataURL: boolean (optional);
        mimeType: string (optional, default: 'text/plan');
      }
Properties in data object take precedent over component props

options.description:
List of objects to be used as options in the dropdown
e.g.
        [
          {
            'label': 'One',
            'value': 1
          },
          {
            'label': 'Two',
            'value': 2
          }
        ]

value.description:
The value of the select dropdown.
Accepts either the value itself or the an entire object from the options array.
e.g. 1 or {'label': 'One', 'value': 1}

items.description:
An array of navbar-items to show on the right side of the navbar.
An item can be a link, a menu label, or a divider.
Each item can support the following properties:
   className: string;
   label: string (the text to show in the item);
   href: string (the href value for link items, ignored if item is menu label);
   target: string (target value to be added to the link);
   icon: string (class name(s) for an icon to display in the navbar-item);
   image: string (src attribute of an image to display in the navbar-item);
   items: array (items to render underneath this item as a dropdown)

     items of items (i.e. dropdown items) can have all the above properties plus the following:

     isDivider: boolean (sets this item as just a horizontal rule with the "navbar-divider" class);
     isMenuLabel: boolean (sets this item as a label with the "menu-label" class);
     items: NavbarItem[];

   isRight: boolean (applies bulma's "is-right" class to the navbar-dropdown
   isArrowless: boolean (Set to true to hide the default angle down arrow created by bulma);
e.g.
        [
          {
            label: "API",
            href: "/api"
          },
          {
            label: "Help",
            href: "/help"
          },
          {
            label: "Apps",
            isRight: true,
            items: [
              {
                label: "Materials",
                href: "/materials"
              },
              {
                label: "Molecules",
                href: "/molecules"
              },
              {
                isDivider: true
              },
              {
                isMenuLabel: true,
                label: "Other"
              },
              {
                label: "External Site",
                href: "https://externalsite.com",
                target: "_blank"
              }
            ]
          }
        ]

An array of navbar-items to show in the dropdown when hovering over the label.
An item can be a link, a menu label, or a divider
Each item can support the following properties:
-- text: string (the text to show in the item)
-- href: string (the href value for link items, ignored if item is menu label)
-- isMenuLabel: boolean (sets this item as a label with the "menu-label" class)
-- isDivider: boolean (sets this item as just a horizontal rule with the "navbar-divider" class)
-- openInNewTab: boolean (will open link in a new tab, only works if href is a full url)
e.g.
        [
          {
            text: "Materials",
            href: "/materials"
          },
          {
            text: "Molecules",
            href: "/molecules"
          },
          {
            isDivider: true
          },
          {
            isMenuLabel: true,
            text: "Other"
          },
          {
            text: "External Site",
            href: "https://externalsite.com",
            openInNewTab: true
          }
        ]

menuGroups.description:
An array of MenuGroup items that is used to build the menu and its links.
Each MenuGroup has an optional label and a required 'items' array of MenuItems.
Each MenuItem has a label that is rendered in the menu and a targetId that is the id of the element it should link to.
Do not include '#' in targetId.
example:
      [
        {label: '...', items: [
          {label: '...', targetId: '...'}, 
          {label: '...', targetId: '...', items: [
            {label: '...', targetId: '...'}
          }]
        ]}
      ]

openAccessUrl.description:
Directly supply the URL to an accessible PDF of the reference
If supplied, the component will not try to fetch an open access URL
@default undefined
